package Jan04;

public class Dowhilex {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
//print the num
		int i = 0;

		/*
		 * do { System.out.println(i);
		 * 
		 * i=i+1; }while(i<5);
		 */

		// do block is executed atleast once

		do {
			System.out.println(i);

			i = i + 1;
		} while (i > 5);

	}

}
